import { FC } from "react";
import { CustomLink } from "../../CustomLink/CustomLink";
import { FaColumnsTable } from "../../icons/icons";

export const MainTableNavigation: FC = () => {
  return (
    <div className="desktop:flex hidden items-center border w-[40%]">
      <div>
        <span className="text-lg pl-6 font-medium  pr-4">Project Name</span>
      </div>
      <div>
        <CustomLink to="/main_table" className="flex border-l">
          <FaColumnsTable />
          <span className="px-4 text-sm font-medium border-l">Main Table </span>
        </CustomLink>
      </div>
      <div>
        <CustomLink to="/timeline">
          <span className="px-4 text-sm font-medium border-l">Timeline </span>
        </CustomLink>
      </div>
    </div>
  );
};
